let Issue = '게임 중독은 질병이다.';
function Main() {
return (
  <div>
    <h1>Today Issue</h1>
    <h3>{Issue}</h3>
    <div><img src="../check-mark.png" width="200px" height="200px"/><img src="../negative.png"width="200px" height="200px"/></div>
  </div>
)
}

export default Main
